
public class 반복문_11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(char c='A';c<='z';c+=2)
		{
			System.out.print(c+" ");
		}
		System.out.println();
		for(int l=1;l<=10;l+=2)
		{
			System.out.print(l+" ");
		}
		System.out.println();
		for(int j=5;j<=100;j+=5)
		{
			System.out.print(j+" ");
		}
	}

}
